import NFLPlayerTable from './NFLPlayerTable'

const NFLPlayers = ({nflPlayers}) => {
  return (
    <>
      <table>
        <NFLPlayerTable nflPlayers={nflPlayers}/>
      </table>
    </>
  )
}

export default NFLPlayers
